		cout << x << " + " << y << " = " 
			 << x + y << endl;
	}
	else if (op == '-') {
		cout << x << " - " << y << " = "
			<< x - y << endl;
	}
	else if (op == '*' || op == 'x') {
		cout << x << " x " << y << " = "
			<< x * y << endl;
	}
	else if (op == '/' || op == ':') {
		if (y != 0) {
			cout << x << " : " << y << " = "
				<< x / y << endl;
		}
		else {
			cout << "Division by zero\n";
		}
	}
	else if (op == '^') {
		cout << x << " ^ " << y << " = "
			<< pow(x, y) << endl;
	}
	else {
		cout << "Bad operator\n";
	}
