#include <math.h>

#include "../s21_decimal.h"

int s21_truncate(s21_decimal value, s21_decimal *result) {
  initDecimal(result);

  s21_decimal pow;
  initDecimal(&pow);
  pow.bits[0] = 10;

  int scale = getScale(value);
  int sign = getSign(value);
  value.bits[3] = 0;

  if (scale > 28) {
    return 1;
  }
  if (!scale) {
    *result = value;
  } else {
    while (scale) {
      s21_div(value, pow, result);
      value = *result;
      scale--;
    }
  }

  setSign(result, sign);
  return 0;
}

int s21_negate(s21_decimal value, s21_decimal *result) {
  initDecimal(result);

  int sign = getSign(value);
  int scale = getScale(value);

  result->bits[0] = value.bits[0];
  result->bits[1] = value.bits[1];
  result->bits[2] = value.bits[2];

  if (sign == 1)
    setSign(result, 0);
  else
    setSign(result, 1);

  setScale(result, scale);
  return 0;
}

int s21_floor(s21_decimal value, s21_decimal *result) {
  initDecimal(result);

  int sign = getSign(value);

  if (sign == 1) {
    s21_negate(value, &value);
  }
  s21_truncate(value, result);

  s21_decimal one;
  initDecimal(&one);
  one.bits[0] = 1;

  if (sign == 1) {
    s21_add(*result, one, result);
  }
  setScale(result, 0);
  if (sign == 1) {
    s21_negate(*result, result);
  }
  return 0;
}

int s21_round(s21_decimal value, s21_decimal *result) {
  s21_decimal ostatok;
  initDecimal(&ostatok);
  ostatok.bits[0] = 5;
  s21_decimal mod_res;
  initDecimal(&mod_res);
  s21_decimal one;
  initDecimal(&one);
  one.bits[0] = 1;

  initDecimal(result);
  int scale = getScale(value);
  int sign = getSign(value);

  if (sign == 1) {
    s21_negate(value, &value);
  }
  s21_truncate(value, result);

  s21_decimal for_mod;
  initDecimal(&for_mod);
  one.bits[0] = pow(10, scale);

  s21_mod(value, for_mod, &mod_res);
  setScale(&ostatok, 1);
  if (s21_is_less_or_equal(ostatok, mod_res)) {
    s21_add(*result, one, result);
  }

  setScale(result, 0);
  if (sign) {
    s21_negate(*result, result);
  }
  return 0;
}

