using Debug = UnityEngine.Debug;
using Random = UnityEngine.Random;
//using QFSW.QC;

public class TerrainGenerator : MonoBehaviour
{
    /*[Command("world-size")]*/ public Vector3Int worldSize = Vector3Int.one * 5;
    
    public float gizmoSize = 0.05f;
    [FormerlySerializedAs("spacing")] public float gizmoSpacing = 5f;
    public bool showGizmos = true;
    public bool showChunkBorders = false;

    public bool removeEmptyChunks = true;
    
    //[Range(-34, 16)]
    public float surfaceLevel = -34f;

    public int seed = 0;

    [FormerlySerializedAs("ChunkSize")] public int chunkSize = 32;

    public ComputeShader terrainShader;
    
    private float[,,] points;
    private Dictionary<Vector3, float> precomputedMeshHeights;

    private PlanetNoise noise;

    private List<Vector3> _vertices = new();
    private List<int> _triangles = new();

    private Dictionary<Vector3, GameObject> _chunks = new(); // Chunk positions will fixed regardless of chunk size. I.e. the first chunk along pos x will be (1, 0, 0)
    private Vector3 _center;

    public Material surfaceMaterial;

    private int _cleanedUpChunks = 0;

    public Vector3Int threadGroupSize = new(128, 4, 2);

    private void Start()
    {
        Generate();
    }

    //[Command("regenerate")]
    private void Regenerate()
    {
        foreach (Transform child in transform)
        {
            Destroy(child.gameObject);
        }

        _triangles.Clear();
        _vertices.Clear();
        precomputedMeshHeights.Clear();
        _chunks.Clear();
        _resultsBuffer.Release();
        
        Generate();
    }

    private void Generate()
    {
        _center = CalculateWorldMidpoint();
        
        PrecomputeMeshHeights();
        
        Stopwatch generationTimer = new();
        generationTimer.Start();

        int totalChunks = worldSize.x * worldSize.y * worldSize.z;
        
        Debug.Log($"Precomputed mesh points. Generating {totalChunks} chunks...");

        for (int x = 0; x < worldSize.x; x++)
        {
            for (int y = 0; y < worldSize.y; y++)
            {
                for (int z = 0; z < worldSize.z; z++)
                {
                    CreateChunk(new Vector3(x * chunkSize, y * chunkSize, z * chunkSize));
                }
            }
        }

        generationTimer.Stop();
        Debug.Log($"Created {totalChunks} chunks in {generationTimer.ElapsedMilliseconds}ms");

        StartCoroutine(UpdateChunks());
        
        if (removeEmptyChunks)
            Debug.Log($"Cleaned up {_cleanedUpChunks} empty chunks");
        Debug.Log($"Spawned {transform.childCount} chunks");
    }

    Vector3 CalculateWorldMidpoint()
    {
        // Calculate total world dimensions in vertices
        Vector3 totalWorldSizeInVertices = new Vector3(worldSize.x * chunkSize, worldSize.y * chunkSize, worldSize.z * chunkSize);

        // Calculate midpoint in vertices
        Vector3 midpointInVertices = totalWorldSizeInVertices / 2f;

        // Adjust for odd number of chunks: If the number of chunks in any dimension is odd,
        // the midpoint in that dimension should be shifted by half the size of a vertex to correctly
        // represent the _center of the world.
        if (worldSize.x % 2 != 0) midpointInVertices.x -= chunkSize / 2f;
        if (worldSize.y % 2 != 0) midpointInVertices.y -= chunkSize / 2f;
        if (worldSize.z % 2 != 0) midpointInVertices.z -= chunkSize / 2f;

        return midpointInVertices;
    }

    // Unused function
    // Remove this and the overload below
    float GenerateRandom(float seed)
    {
        Vector3 vec = new Vector3(seed, seed * seed, seed * seed * seed);
        Vector3 coef = new Vector3(12.9898f, 78.233f, 54.53f);
        float dotProduct = Vector3.Dot(vec, coef);
        float sinValue = MathF.Sin(dotProduct);
        float randomValue = sinValue * 43758.5453f;
        return randomValue - MathF.Floor(randomValue); // This mimics the HLSL frac function
    }
    public float GenerateRandom(float seed, float min, float max)
    {
        float normalizedRandom = GenerateRandom(seed);
        return Mathf.Lerp(min, max, normalizedRandom);
    }

    private void PrecomputeMeshHeights()
    {
        Stopwatch meshHeightPrecomputeTimer = new();
        meshHeightPrecomputeTimer.Start();
        
        int xSize = Mathf.CeilToInt((chunkSize + 1) * worldSize.x);
        int ySize = Mathf.CeilToInt((chunkSize + 1) * worldSize.y);
        int zSize = Mathf.CeilToInt((chunkSize + 1) * worldSize.z);

        precomputedMeshHeights = new();

        /*for (int x = 0; x < xSize; x++)
        {
            for (int y = 0; y < ySize; y++)
            {
                for (int z = 0; z < zSize; z++)
                {
                    
                    Vector3 point = new Vector3(x, y, z);

                    //float v = EvaluateRidgedMultifractal(point, Vector3.zero);
                    float v = EvaluateSpherical(point, _center);
                    
                    precomputedMeshHeights.Add(point, v);
                }
            }
        }*/
        
        // Always use the compute shader, it is very easy to crash Unity
        // by using the for loops above. Only times the C# noise generator
        // should be used is for testing noise functions without porting
        // them to HLSL.
        
        DispatchToCompute(xSize, ySize, zSize, _center);

        meshHeightPrecomputeTimer.Stop();
        Debug.Log($"Precomputed {xSize * ySize * zSize:#,#} noise values in {meshHeightPrecomputeTimer.ElapsedMilliseconds}ms");
    }

    void GeneratePoints(Vector3 chunkPosition)
    {
        int resolution = chunkSize + 1;

        points = new float[resolution, resolution, resolution];

        for (int x = 0; x < resolution; x++)
        {
            for (int y = 0; y < resolution; y++)
            {
                for (int z = 0; z < resolution; z++)
                {
                    Vector3 genPoint = new Vector3(x + chunkPosition.x, y + chunkPosition.y, z + chunkPosition.z);
                    // Round the key values before accessing the dictionary
                    Vector3 roundedGenPoint = new Vector3(
                        Mathf.Round(genPoint.x),
                        Mathf.Round(genPoint.y),
                        Mathf.Round(genPoint.z)
                        );

                    try
                    {
                        points[x, y, z] = precomputedMeshHeights[roundedGenPoint];
                    }
                    catch (Exception e)
                    {
                        throw new Exception("", e);
                    }
                }
            }
        }
    }

    float EvaluateRidgedMultifractal(Vector3 point, Vector3 offset)
    {
        noise = new PlanetNoise(seed);
    
        // Original coordinates for noise
        
        float xCoord = point.x * 0.1f + offset.x;
        float yCoord = point.y * 0.1f + offset.y;
        float zCoord = point.z * 0.1f + offset.z;

        // Evaluate noise using the modified coordinates
        float ridgedValue = noise.Evaluate(new Vector3(xCoord, yCoord, zCoord));
        ridgedValue = 1 - Mathf.Abs(2 * ridgedValue - 1); // Make it ridge-like

        // Map the Ridged Multifractal value to the desired range (-34 to 16)
        float minValue = -34f;
        float maxValue = 16f;

        float result = Mathf.Lerp(minValue, maxValue, ridgedValue);

        return result;
    }

    public float EvaluateSpherical(Vector3 position, Vector3 centerPoint, float minRange = -34f, float maxRange = 16f)
    {
        // Calculate Euclidean distance from the position to the _center point
        float distance = Vector3.Distance(centerPoint, position) * -1;
        
        // Apply a noise function to the distance. You might need to scale the distance
        // to get more interesting patterns. Adjust 'scale' as needed.
        float scale = 0.1f; // Scale factor for noise input
        float noiseValue = Mathf.PerlinNoise(distance * scale, 0); // Using 2D Perlin noise as an example

        // Optionally, apply further transformations to noiseValue here to shape the noise

        // Map the noise value from [0, 1] to [minRange, maxRange]
        float mappedValue = distance;
        //mappedValue = Mathf.Lerp(maxRange, minRange, distance);
        //mappedValue = Mathf.InverseLerp(maxRange, minRange, -mappedValue);

        return mappedValue;
    }
    
    public static float GenerateNoisePoint(Vector3 point, int seed, Vector3 offset, float scale, int octaves, float persistence, float lacunarity)
    {
        System.Random prng = new System.Random(seed);

        float amplitude = 1;
        float frequency = 1;
        float noiseHeight = 0;

        for (int i = 0; i < octaves; i++)
        {
            float sampleX = (point.x + prng.Next(-100000, 100000) + offset.x) / scale * frequency;
            float sampleY = (point.y + prng.Next(-100000, 100000) + offset.y) / scale * frequency;
            float sampleZ = (point.z + prng.Next(-100000, 100000) + offset.z) / scale * frequency;

            float perlinValue = Mathf.PerlinNoise(sampleX, sampleY) * 2 - 1;
            noiseHeight += perlinValue * amplitude;

            amplitude *= persistence;
            frequency *= lacunarity;
        }
        
        // Normalize locally within the function
        noiseHeight = Mathf.InverseLerp(float.MinValue, float.MaxValue, noiseHeight);

        return noiseHeight;
    }
    
    private float PerlinNoise3D (float x, float y, float z)
    {
        float xy = Mathf.PerlinNoise(x, y);
        float xz = Mathf.PerlinNoise(x, z);
        float yz = Mathf.PerlinNoise(y, z);

        float yx = Mathf.PerlinNoise(y, x);
        float zx = Mathf.PerlinNoise(z, x);
        float zy = Mathf.PerlinNoise(z, y);

        return (xy + xz + yz + yx + zx + zy) / 6;
    }

    Mesh GenerateMesh()
    {
        Mesh mesh = new Mesh();

        //mesh.indexFormat = IndexFormat.UInt32;

        mesh.vertices = _vertices.ToArray();
        mesh.triangles = _triangles.ToArray();

        mesh.RecalculateNormals();

        return mesh;
    }

    void CreateChunk(Vector3 position)
    {
        // Adjust position based on the object's position
        // position += transform.position;

        GeneratePoints(position);

        GameObject chunk = new GameObject($"Chunk ({Mathf.RoundToInt(position.x / chunkSize)}, {Mathf.RoundToInt(position.y / chunkSize)}, {Mathf.RoundToInt(position.z / chunkSize)})");
        MeshFilter chunkMeshFilter = chunk.AddComponent<MeshFilter>();
        MeshRenderer chunkMeshRenderer = chunk.AddComponent<MeshRenderer>();
        MeshCollider chunkCollider = chunk.AddComponent<MeshCollider>();

        chunkMeshRenderer.sharedMaterial = surfaceMaterial;

        MarchCubes();

        Mesh m = GenerateMesh();

        if ((m.vertices.Length > 0 && m.triangles.Length > 0) || !removeEmptyChunks)
        {
            chunkMeshFilter.sharedMesh = m;
            
            chunkCollider.sharedMesh = m;
            chunkCollider.convex = false;
            
            chunk.transform.position = position;

            chunk.transform.parent = transform;

            _chunks.Add(position / chunkSize, chunk);
        }
        else
        {
            // Clean up empty chunks
            Destroy(chunk);
            _cleanedUpChunks++;
        }
    }

    private void MarchCubes()
    {
        _vertices.Clear();
        _triangles.Clear();

        for (int x = 0; x < chunkSize; x++)
        {
            for (int y = 0; y < chunkSize; y++)
            {
                for (int z = 0; z < chunkSize; z++)
                {
                    float[] cubeCorners = new float[8];

                    for (int i = 0; i < 8; i++)
                    {
                        Vector3Int corner = new Vector3Int(x, y, z) + MarchingCubesTable.Corners[i];
                        cubeCorners[i] = points[corner.x, corner.y, corner.z];
                    }

                    MarchCube(new Vector3(x, y, z), cubeCorners);
                }
            }
        }
    }
    
    private void MarchCube(Vector3 position, float[] cubeCorners)
    {
        int configIndex = GetConfigurationIndex(cubeCorners);

        if (configIndex == 0 || configIndex == 255)
        {
            return;
        }

        int edgeIndex = 0;
        for (int t = 0; t < 5; t++)
        {
            for (int v = 0; v < 3; v++)
            {
                int triTableValue = MarchingCubesTable.Triangles[configIndex, edgeIndex];

                if (triTableValue == -1)
                {
                    return;
                }

                // Access edge start and end using integer indices
                Vector3 edgeStartIndex = MarchingCubesTable.Edges[triTableValue, 0];
                Vector3 edgeEndIndex = MarchingCubesTable.Edges[triTableValue, 1];

                // Convert indices to Vector3, if necessary, or use directly if your logic supports Vector3Int
                Vector3 edgeStart = position + new Vector3(edgeStartIndex.x, edgeStartIndex.y, edgeStartIndex.z);
                Vector3 edgeEnd = position + new Vector3(edgeEndIndex.x, edgeEndIndex.y, edgeEndIndex.z);

                Vector3 vertex = (edgeStart + edgeEnd) / 2;

                _vertices.Add(vertex);
                _triangles.Add(_vertices.Count - 1);

                edgeIndex++;
            }
        }
    }
    
    private Vector3 InterpolateVertex(Vector3 p1, Vector3 p2, float valP1, float valP2)
    {
        if (Mathf.Abs(surfaceLevel - valP1) < 0.00001)
            return p1;
        if (Mathf.Abs(surfaceLevel - valP2) < 0.00001)
            return p2;
        if (Mathf.Abs(valP1 - valP2) < 0.00001)
            return p1;
    
        float t = (surfaceLevel - valP1) / (valP2 - valP1);
        return p1 + t * (p2 - p1);
    }

    private int GetConfigurationIndex(float[] cubeCorners)
    {
        int configIndex = 0;

        for (int i = 0; i < 8; i++)
        {
            if (cubeCorners[i] < surfaceLevel)
            {
                configIndex |= 1 << i;
            }
        }

        return configIndex;
    }

    private IEnumerator UpdateChunks()
    {
        while (true)
        {
            foreach (KeyValuePair<Vector3,GameObject> chunk in _chunks)
            {
                //chunk.Value.GetComponent<Renderer>().enabled = IsVisible(chunk.Value);
                chunk.Value.SetActive(IsVisible(chunk.Value));
            }

            yield return null;
        }
    }

    private bool IsVisible(GameObject obj)
    {
        Bounds objectBounds = obj.GetComponent<Renderer>().bounds;
        
        return GeometryUtility.TestPlanesAABB(GeometryUtility.CalculateFrustumPlanes(Camera.main), objectBounds);
    }

    private void OnDrawGizmos()
    {
        Gizmos.color = Color.red;
        Gizmos.DrawSphere(_center, 0.6f);

        if (showChunkBorders)
        {
            foreach (KeyValuePair<Vector3,GameObject> chunk in _chunks)
            {
                Renderer r = chunk.Value.GetComponent<Renderer>();
                Bounds b = r.bounds;
            
                Gizmos.color = Color.yellow;
                // Draw a wireframe box around the bounds of the Mesh Renderer
                Gizmos.DrawWireCube((chunk.Key + Vector3.one / 2) * chunkSize, Vector3.one * chunkSize);
            }
        }
        
        if (!showGizmos) return;
        
        if (points == null || points.GetLength(0) <= 0 || 
            points.GetLength(1) <= 0 || 
            points.GetLength(2) <= 0)
            return;
        
        for (int x = 0; x < points.GetLength(0); x++)
        {
            for (int y = 0; y < points.GetLength(1); y++)
            {
                for (int z = 0; z < points.GetLength(2); z++)
                {
                    if (points[x, y, z] >= surfaceLevel)
                    {
                        Color color = EvaluateColor(points[x, y, z]);
                        Gizmos.color = color;
                        Vector3 position = new Vector3(x, y, z) * gizmoSize * gizmoSpacing;
                        Gizmos.DrawSphere(position, gizmoSize);
                    }
                }
            }
        }
    }

    Color EvaluateColor(float value)
    {
        // Map the terrain value to a normalized range (0 to 1)
        float normalizedValue = Mathf.InverseLerp(-34f, 16f, value);

        // Map the normalized value to a color between black and white
        Color color = Color.Lerp(Color.black, Color.white, normalizedValue);

        return color;
    }

    ComputeBuffer _resultsBuffer;
    void DispatchToCompute(int xSize, int ySize, int zSize, Vector3 worldCenter)
    {
        if (SystemInfo.supportsComputeShaders)
        {
            int totalThreads = threadGroupSize.x * threadGroupSize.y * threadGroupSize.z;
            if (SystemInfo.maxComputeWorkGroupSize >= totalThreads)
            {
                int kernelIndex = terrainShader.FindKernel("CSMain");

                int totalPoints = xSize * ySize * zSize;
            
                int threadsX = Mathf.CeilToInt((float)xSize / threadGroupSize.x);
                int threadsY = Mathf.CeilToInt((float)ySize / threadGroupSize.y);
                int threadsZ = Mathf.CeilToInt((float)zSize / threadGroupSize.z);

                int bufferSize = totalPoints;
                int stride = System.Runtime.InteropServices.Marshal.SizeOf(typeof(NoiseValue));
                _resultsBuffer = new ComputeBuffer(bufferSize,  stride);
                
                Debug.Log($"Created compute buffer with a size of {bufferSize} and a stride of {stride}. Total size: {(bufferSize * stride) / 1024 / 1024} MB");
            
                terrainShader.SetVector("worldSize", new Vector3(xSize, ySize, zSize));
                terrainShader.SetVector("worldCenter", worldCenter);
            
                terrainShader.SetBuffer(kernelIndex, "Result", _resultsBuffer);
            
                Debug.Log($"Dispatching {totalPoints} points over {threadsX * threadsY * threadsZ} threads");
                terrainShader.Dispatch(0, threadsX, threadsY, threadsZ);

                NoiseValue[] results = new NoiseValue[bufferSize];
                _resultsBuffer.GetData(results);

                foreach (NoiseValue result in results)
                {
                    Vector3 pos = result.position;
                    float value = result.value;
                
                    precomputedMeshHeights.Add(pos, value);
                }
            
                _resultsBuffer.Release();
            }
            else
            {
                Debug.LogError($"Max allowed Compute Shader threads is less than {threadGroupSize}! GPU: {SystemInfo.graphicsDeviceName} Max compute work threads: {SystemInfo.maxComputeWorkGroupSize}");
                Application.Quit(16); // Exit code 16 will mean compute shaders are supported but the GPU doesn't have enough CUDA cores to run the compute shader or does not allow upto 1000 compute worker threads to be ran
            }
        }
        else
        {
            Debug.LogError($"Compute shaders are not supported by this device! GPU: {SystemInfo.graphicsDeviceName}");
            Application.Quit(15); // Exit code 15 will mean compute shaders are not supported
        }
    }

    struct NoiseValue
    {
        public Vector3 position;
        public float value;
    }
}

[Serializable]
public class DictionaryElement<TKey, TValue>
{
    public TKey key;
    public TValue value;

    public DictionaryElement(TKey key, TValue value)
    {
        this.key = key;
        this.value = value;
    }
}
